class FCN(object):
	def __init__(self, stride, sourceDir, name):
		self.handler = DataHandler()
		loadedModel = self.handler.loadModel(sourceDir, name)
		loadedModel2 = self.handler.loadModel(sourceDir, "model")
		print(loadedModel.summary())

		weights = loadedModel2.get_layer(name="conv3d_3").get_weights()
		print(weights[0].shape)

		#create fully convolutional network (used for index mapping)
		FCN2 = Sequential()
		FCN2.add(Conv3D(64, (3, 5, 5), input_shape=(1, None, None, None), strides = (stride,stride,stride) , padding='valid', activation='relu', data_format = "channels_first"))
		FCN2.add(loadedModel2.get_layer(name="max_pooling3d_1"))
		FCN2.add(loadedModel2.get_layer(name="conv3d_2"))
		FCN2.add(loadedModel2.get_layer(name="conv3d_3"))
		FCN2.add(Conv3D(150, (2, 2, 2), name = "conv3d_4", activation='relu', padding='valid', data_format = "channels_first"))
		FCN2.add(Conv3D(2, (1, 1, 1), name = "conv3d_5", activation='softmax', padding='valid', data_format = "channels_first"))
		FCN2.compile(loss='mean_squared_error', optimizer='sgd')
		self.FCN2 = FCN2

		#create fully convolutional network (used for the actual prediction)
		FCN = Sequential()
		FCN.add(Conv3D(64, (3, 5, 5), input_shape=(None, None, None, 1),
		                strides=(stride,stride,stride), padding='valid', activation='relu',
		                data_format='channels_last', name="convolution3d_1"))
		FCN.add(Dropout(0.2))
		FCN.add(MaxPooling3D(pool_size=(2, 2, 2)))
		FCN.add(Conv3D(64, (3, 3, 3), activation='relu', padding='valid', name="convolution3d_2"))
		FCN.add(Conv3D(64, (1, 3, 3), activation='relu', padding='valid', name="convolution3d_3"))
		FCN.add(Dropout(0.5))
		FCN.add(Conv3D(150, (2, 2, 2), activation='relu', padding='valid', name="convolution3d_4"))
		FCN.add(Conv3D(2, (1, 1, 1), activation='softmax', padding='valid', name="convolution3d_5"))
		FCN.compile(loss='categorical_crossentropy', optimizer='sgd', metrics=['accuracy'])
		print(FCN.summary())

		Conv1W = loadedModel.get_layer(name="convolution3d_1").get_weights()
		Conv2W = loadedModel.get_layer(name="convolution3d_2").get_weights()
		Conv3W = loadedModel.get_layer(name="convolution3d_3").get_weights()
		Conv4W = loadedModel.get_layer(name="dense_1").get_weights()
		print(Conv4W[0].shape)
		Conv4W[0] = Conv4W[0].T.reshape((150, 64, 2, 2, 2))
		Conv4W[0] = np.swapaxes(Conv4W[0], 0, 4)
		Conv4W[0] = np.swapaxes(Conv4W[0], 1, 3)
		Conv5W = loadedModel.get_layer(name="dense_2").get_weights()
		Conv5W[0] = Conv5W[0].T.reshape((2, 150, 1, 1, 1))
		Conv5W[0] = np.swapaxes(Conv5W[0], 0, 4)
		Conv5W[0] = np.swapaxes(Conv5W[0], 1, 3)

		print(FCN.get_layer(name="convolution3d_4").get_weights()[0].shape)

		FCN.get_layer(name="convolution3d_1").set_weights(Conv1W)
		FCN.get_layer(name="convolution3d_2").set_weights(Conv2W)
		FCN.get_layer(name="convolution3d_3").set_weights(Conv3W)
		FCN.get_layer(name="convolution3d_4").set_weights(Conv4W)
		FCN.get_layer(name="convolution3d_5").set_weights(Conv5W)
		self.FCN = FCN

	def testFCN(self, testSize):
		xs, ys = self.handler.load_samples("../Data/sampless/subset{}/".format(9), (1,10,16,16))
		xs = xs[0:testSize]
		ys = ys[0:testSize]
		print("Testing on {} samples".format(testSize))
		numCorrect = 0
		for i in range(testSize):
			pre = self.FCN.predict(xs[i].reshape((1,10,16,16,1)), batch_size=1)
			if (pre[0][0][0][0][1] > 0.5 and ys[i] == 1) or (pre[0][0][0][0][1] < 0.5 and ys[i] == 0):
			    numCorrect += 1
		print("Predicted {} out of {} correctly".format(numCorrect, testSize))


	#Takes in an inputsize, a sequence FCN and the output value for that FCN
	#Returns:
		# (1) an input sized 3d Array with the index mapped output values
		# (2) a list of the indicies in this index sized array that were mapped too
	def indexMapping(self, initialOutput, inputSize):

		#Maps from the first output just to get the values in the mix
		originalMap = initialOutput[:,1,:,:,:] #Uses the map for probability that it is there

		#The input sized array that is going to be populated with values
		toPopulate = np.zeros(inputSize)
		#Finds all input values we need

		strides = []
		kernels = []

		layers = self.FCN2.layers

		populatedIndicies = []
		for i in range(len(layers)):
			xStride = layers[i].get_config()['strides'][1]
			yStride = layers[i].get_config()['strides'][2]
			zStride = layers[i].get_config()['strides'][0]
			strides.append([zStride,xStride,yStride])

			if 'pooling' not in layers[i].name:
				xKernel = layers[i].get_config()['kernel_size'][1]
				yKernel = layers[i].get_config()['kernel_size'][2]
				zKernel = layers[i].get_config()['kernel_size'][0]
				kernels.append([zKernel, xKernel, yKernel])


			else:
				xPool = layers[i].get_config()['pool_size'][1]
				yPool = layers[i].get_config()['pool_size'][2]
				zPool = layers[i].get_config()['pool_size'][0]
				kernels.append([zPool,yPool,xPool])

		i = 0
		#First three for loops find the value to be put back
		for z in range(originalMap.shape[1]):
			for x in range(originalMap.shape[2]):
				for y in range(originalMap.shape[3]):
					i = i + 1
					if i % 1000 == 0:
						pass
						#print(i)
					#The value to put into the input sized map
					value = originalMap[0,z,x,y]
					if value >= 0.6:
						#populatedIndicies.append([(z,x,y), value])
						#Resets indicies values to what they start as
						xindex = x
						yindex = y
						zindex = z

						#Generates the indicies to put it in
						for i in reversed(range(len(strides))):
							zindex = zindex * strides[i][0] + floor((kernels[i][0] -1) /2)
							xindex = xindex * strides[i][1] + floor((kernels[i][1] -1) /2)
							yindex = yindex * strides[i][2] + floor((kernels[i][2] -1) /2)

						populatedIndicies.append([(int(zindex),int(xindex),int(yindex)), value])

						#Puts the value in the original input size at the indicies

						toPopulate[int(zindex)][int(xindex)][int(yindex)] = value

		#Returns the populated input sized array, returns the indicies of the nonzero values in that array
		return toPopulate, populatedIndicies

	def predict(self, image, imageSpacing, targetSpacing):
	    image = scipy.ndimage.interpolation.zoom(image, (float(imageSpacing[0])/targetSpacing[0],
	                                                float(imageSpacing[1])/targetSpacing[1],
	                                                float(imageSpacing[2])/targetSpacing[2]))
	    image = self.handler.normalizePlanes(image)
	    print(image.shape)
	    pred = self.FCN.predict(image.reshape(1,image.shape[0],image.shape[1],image.shape[2], 1), batch_size=1)
	    return pred, image.shape




